#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define MAX_LENGTH 13
#define MAX_SIZE 1000000

typedef struct Node {
    char str[MAX_LENGTH];
    struct Node* next;
} Node;

typedef struct Dictionary {
    Node* head;
} Dictionary;

void insert(Dictionary* dict, char* str) {
    Node* new_node = (Node*)malloc(sizeof(Node));
    strcpy(new_node->str, str);
    new_node->next = dict->head;
    dict->head = new_node;
}

int find(Dictionary* dict, char* str) {
    Node* current = dict->head;
    while (current != NULL) {
        if (strcmp(current->str, str) == 0) {
            return 1;
        }
        current = current->next;
    }
    return 0;
}

int main() {
    int n;
    scanf("%d", &n);
    Dictionary dict;
    dict.head = NULL;

    for (int i = 0; i < n; i++) {
        char command[10];
        char str[MAX_LENGTH];
        scanf("%s", command);
        if (strcmp(command, "insert") == 0) {
            scanf("%s", str);
            insert(&dict, str);
        } else if (strcmp(command, "find") == 0) {
            scanf("%s", str);
            printf("%s\n", find(&dict, str) ? "yes" : "no");
        }
    }

    return 0;
}
